#include <stdio.h>

#define CTE 16
#define qq 986
#define CONERROR 0
#define SINERROR 1

int main() {

    char car1, car2;
    int cuno, cdos;
    int valor, valor1, valor2;

    do {
        valor1 = 0, valor2 = 0;
        cuno = SINERROR, cdos = SINERROR;

        printf("Introduzca el numero hexadecimal: ");
        scanf("\n%c%c", &car1, &car2);

        if(car1 != 'q' && car2 != 'q') {

            if(car1 >= '0' && car1 <= '9')
                valor1 = car1 - '0';
            else if(car1 >= 'a' && car1 <= 'f')
                valor1 = car1 - 'a' + 10;
            else if(car1 >= 'A' && car1 <= 'F')
                valor1 = car1 - 'A' + 10;
            else {
                printf("Error en el primer valor introducido\n");
                cuno = CONERROR;
            }

            if(car2 >= '0' && car2 <= '9')
                valor2 = car2 - '0';
            else if(car2 >= 'a' && car2 <= 'f')
                valor2 = car2 - 'a' + 10;
            else if(car2 >= 'A' && car2 <= 'F')
                valor2 = car2 - 'A' + 10;
            else {
                printf("Error en el segundo valor introducido\n");
                cdos = CONERROR;
            }

            if(cuno != CONERROR && cdos != CONERROR) {
                valor = CTE * valor1 + valor2;
                printf("El valor decimal de 0x%c%c es %d \n", car1, car2, valor);
            }

        }

    } while (car1 != 'q' && car2 != 'q');

    return 0;
}

bool TestWMI::getAnything(QQueue<QPair<QString, QString> > &records, QString WQLTable, const QQueue<QPair<QString, QString>> &field_caption)
{
    try
    {
        HRESULT hres;

        hres =  CoInitializeEx(0, COINIT_MULTITHREADED);
        if (FAILED(hres)/* && hres != -2147417850*/)
        {
            throw "Invalid result!";              // Program has failed.
        }

        hres =  CoInitializeSecurity(
            NULL,
            -1,                          // COM authentication
            NULL,                        // Authentication services
            NULL,                        // Reserved
            RPC_C_AUTHN_LEVEL_DEFAULT,   // Default authentication
            RPC_C_IMP_LEVEL_IDENTIFY,    // Default Impersonation
            NULL,                        // Authentication info
            EOAC_NONE,                   // Additional capabilities
            NULL                         // Reserved
            );


        if (FAILED(hres && hres != RPC_E_TOO_LATE))
        {
            throw "Invalid result!";                   // Program has failed.
        }

        IWbemLocator *pLoc = NULL;

        hres = CoCreateInstance(
            CLSID_WbemLocator,
            0,
            CLSCTX_INPROC_SERVER,
            IID_IWbemLocator, (LPVOID *) &pLoc);

        if (FAILED(hres))
        {
            throw "Invalid result!";               // Program has failed.
        }

        auto pLoc_deleter = [](IWbemLocator* p) { p->Release(); };
        std::unique_ptr<IWbemLocator, decltype(pLoc_deleter)> spLoc1(pLoc, pLoc_deleter);

        IWbemServices *pSvc = NULL;

        QString str = "ROOT\CIMV2";
        if (lpRemoteName != "")
            str = lpRemoteName + "\" + str;

        BSTR bstr = QStringToBSTR(str);

        auto bstr_del = [](BSTR b) {SysFreeString(b);};
        std::unique_ptr<OLECHAR, decltype(bstr_del)> sbstr(bstr, bstr_del);

        hres = spLoc1.get()->ConnectServer(
            sbstr.get(),
            NULL,    // User name
            NULL,     // User password
            NULL,                              // Locale
            NULL,                              // Security flags
            NULL,// Authority
            NULL,                              // Context object
            &pSvc                              // IWbemServices proxy
            );

        if (FAILED(hres))
        {
            spLoc1 = nullptr;
            throw "Invalid result!";                 // Program has failed.
        }

        auto pSvc_deleter = [](IWbemServices* p) {p->Release(); };
        std::unique_ptr<IWbemServices, decltype(pSvc_deleter)> spSvc1(pSvc, pSvc_deleter);

        hres = CoSetProxyBlanket(
           spSvc1.get(),                           // Indicates the proxy to set
           RPC_C_AUTHN_DEFAULT,            // RPC_C_AUTHN_xxx
           RPC_C_AUTHZ_DEFAULT,            // RPC_C_AUTHZ_xxx
           COLE_DEFAULT_PRINCIPAL,         // Server principal name
           RPC_C_AUTHN_LEVEL_PKT_PRIVACY,  // RPC_C_AUTHN_LEVEL_xxx
           RPC_C_IMP_LEVEL_IMPERSONATE,    // RPC_C_IMP_LEVEL_xxx
           NULL,                       // client identity
           EOAC_NONE                       // proxy capabilities
        );

        if (FAILED(hres))
        {
            throw "Invalid result!";               // Program has failed.
        }

        BSTR bstr1 = QStringToBSTR("WQL");

        auto bstr_deleter1 = [](BSTR b) { SysFreeString(b); };
        std::unique_ptr<OLECHAR, decltype(bstr_deleter1)> sbstr1(bstr1, bstr_deleter1);

        BSTR bstr2 =  QStringToBSTR("Select * from " + WQLTable);

        auto bstr_deleter2 = [](BSTR b) { SysFreeString(b); };
        std::unique_ptr<OLECHAR, decltype(bstr_deleter2)> sbstr2(bstr2, bstr_deleter2);

        IEnumWbemClassObject* pEnumerator = NULL;
        hres = spSvc1.get()->ExecQuery(
            sbstr1.get(),
            sbstr2.get(),
            WBEM_FLAG_FORWARD_ONLY | WBEM_FLAG_RETURN_IMMEDIATELY,
            NULL,
            &pEnumerator);

        auto pEnumerator_deleter = [](IEnumWbemClassObject* p) { p->Release(); };
        std::unique_ptr<IEnumWbemClassObject, decltype(pEnumerator_deleter)> spEnumerator(pEnumerator, pEnumerator_deleter);

        if (FAILED(hres))
        {
            throw "Invalid result!";               // Program has failed.
        }

        IWbemClassObject *pclsObj = NULL;
        ULONG uReturn = 0;

        while (spEnumerator.get())
        {
            HRESULT hr = spEnumerator.get()->Next(WBEM_INFINITE, 1,
                &pclsObj, &uReturn);

            if(0 == uReturn)
            {
                break;
            }

            auto pclsObj_deleter = [](IWbemClassObject* p) { p->Release(); };
            std::unique_ptr<IWbemClassObject, decltype(pclsObj_deleter)> spclsObj(pclsObj, pclsObj_deleter);

            VARIANT vtProp;

            for (auto &k : field_caption)
            {
                spclsObj.get()->Get(reinterpret_cast<LPCWSTR>(k.first.utf16()), 0, &vtProp, 0, 0);
                records.enqueue(QPair<QString, QString>(k.second, QString::fromStdWString(vtProp.bstrVal)));
            }

            VariantClear(&vtProp);
        }

        spLoc1 = nullptr;
        spSvc1 = nullptr;
        sbstr = nullptr;
        sbstr1 = nullptr;
        sbstr2 = nullptr;
        spEnumerator = nullptr;
        CoUninitialize();
    }
    catch (const char* e)
    {
        qDebug() << "Exception in WMI";
        CoUninitialize();
        return false;
    }
    return true;
}
	
